using System;
using System.Collections.Generic;
using Xunit;
using XGaleryPhotos.Interfaces;
using XGaleryPhotos.Models;
using XGaleryPhotos.Services;

namespace ZTests
{
    public class FotosUpdateTests
    {
        [Fact]
        public void TestFotosUpdate_NoFotos()
        {
            // Prepara
            IRepositoryService service = new RepositoryService();
            string imagenString = "";

            Flujo flujo = new Flujo
            {
                FlujoNro = "280R",
                TipoDocumento = "RE - RC Atencion",
                DocumentoNro = 4,
                Fotos = new List<Foto>()
                {
                    new Foto
                    {
                        ImgString = imagenString
                    }
                }
            };

            service.UpdateFotos(flujo, "LeVargas");
            bool estadoValido = flujo.EsValido;

            // Prueba
            Assert.True(estadoValido);
        }
    }
}

